%python

import os

category_map = {
    'breaker_box': [],
    'sump_pump': [],
    'washer': []
}

category_to_idx = {
    'breaker_box': 0,
    'sump_pump': 1,
    'washer': 2
}

data_dir = '/data/household/images/'
counter = 0
for root, dirs, files in os.walk(data_dir):
    category = root.split("/")[-1]
    for f in files:
        category_map[category].append({
            'idx': counter,
            'label': category_to_idx[category],
            'filename': files,
            'filepath': root + '/' + f
        })
        counter += 1

for k in category_map:
    print(k, len(category_map[k]))
